import { Container } from "react-bootstrap";
import Image from 'react-bootstrap/Image';
import image from 'C:\Users\aakas\OneDrive\Desktop\Foodie Adda Starter Project React\public\banner.png';
function HomeBanner(){

    return (
        <Container fluid>
            <div className="bannerImgDiv">
               <Image src={image}>
               </Image>
            </div>
        </Container>
    );

}

export default HomeBanner;
